import React from "react";

function App() {
  const navigateToPage = (page) => {
    window.location.href = page; // Navigate to the specified page
  };

  return (
    <div className="chaomung-wrapper position-relative">
      <div className="h-100 d-flex align-items-center">
        <div className="w-100 d-flex justify-content-center align-items-center" >
          <div className="main-page">
            <img
              src="https://via.placeholder.com/600x300" // Replace with your image URL
              alt="Example"
              className="main-image"
            />
            <h1 className="main-title">Chào mừng bạn đến với trang chính!</h1>
            <div className="button-container">
              <button onClick={() => navigateToPage("/danhsach")}>Đi đến Danh Sách</button>
              <button onClick={() => navigateToPage("/dangky")}>Đi đến Đăng Ký</button>
            </div>

            <style jsx>{`
        .main-page {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          height: 100vh;
          text-align: center;
        }

        .main-image {
          width: 100%;
          max-width: 600px;
          height: auto;
          margin-bottom: 20px;
        }

        .main-title {
          font-size: 2.5rem;
          margin-bottom: 20px;
        }

        .button-container {
          display: flex;
          gap: 10px;
        }

        button {
          padding: 10px 20px;
          border: none;
          border-radius: 5px;
          background-color: #007bff;
          color: white;
          cursor: pointer;
        }

        button:hover {
          background-color: #0056b3;
        }
      `}</style>
          </div></div></div></div>
  );
}

export default App;
